// src/Login.js
import React, { useState } from 'react';
import axios from 'axios';
import { motion } from 'framer-motion';

const Login = ({ setAuthUser }) => {
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState('');

    const handleLogin = async (e) => {
        e.preventDefault();
        setLoading(true);
        setError('');
        
        try {
            const res = await axios.post('http://localhost:8000/api/login/', { 
                username, 
                password 
            });
            
            console.log("Login Response Data:", res.data);

            // JWT returns 'access' and 'refresh' tokens
            if (res.data.access) {
                localStorage.setItem('access_token', res.data.access);
                localStorage.setItem('refresh_token', res.data.refresh);
                localStorage.setItem('username', username); // Save username from input
                
                setAuthUser(username);
                window.location.reload(); 
            } else {
                setError("Token not found in response.");
                console.error("Token not found in response. Check your Django SimpleJWT setup.");
            }
        } catch (err) {
            console.error("Login Error Details:", err.response?.data);
            setError(err.response?.data?.detail || "Login failed! Check your credentials.");
        } finally {
            setLoading(false);
        }
    };

    return (
        <motion.div
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            style={styles.container}
        >
            <form onSubmit={handleLogin} style={styles.form}>
                <h2 style={styles.title}>Welcome Back</h2>
                <p style={styles.subtitle}>Sign in to continue your conversations</p>
                
                {error && <div style={styles.error}>{error}</div>}
                
                <div style={styles.fieldGroup}>
                    <label style={styles.label}>Username</label>
                    <input 
                        type="text" 
                        placeholder="Enter your username" 
                        style={styles.input}
                        value={username}
                        onChange={e => setUsername(e.target.value)} 
                        required 
                    />
                </div>
                
                <div style={styles.fieldGroup}>
                    <label style={styles.label}>Password</label>
                    <input 
                        type="password" 
                        placeholder="Enter your password" 
                        style={styles.input}
                        value={password}
                        onChange={e => setPassword(e.target.value)} 
                        required 
                    />
                </div>
                
                <motion.button 
                    type="submit"
                    style={styles.button}
                    whileHover={{ scale: 1.02 }}
                    whileTap={{ scale: 0.98 }}
                    disabled={loading}
                >
                    {loading ? 'Signing in...' : 'Sign In'}
                </motion.button>
            </form>
        </motion.div>
    );
};

const styles = {
    container: {
        width: '100%',
        maxWidth: '440px',
        padding: '40px',
        background: 'linear-gradient(135deg, rgba(15,23,42,0.95), rgba(15,23,42,0.88))',
        borderRadius: '24px',
        border: '1px solid rgba(148,163,184,0.35)',
        backdropFilter: 'blur(26px)',
    },
    form: {
        display: 'flex',
        flexDirection: 'column',
        gap: '20px'
    },
    title: {
        fontSize: '28px',
        fontWeight: '800',
        color: '#f9fafb',
        margin: 0
    },
    subtitle: {
        color: '#9ca3af',
        fontSize: '14px',
        margin: 0
    },
    error: {
        padding: '12px',
        background: 'rgba(239, 68, 68, 0.1)',
        border: '1px solid rgba(239, 68, 68, 0.3)',
        borderRadius: '8px',
        color: '#fca5a5',
        fontSize: '14px'
    },
    fieldGroup: {
        display: 'flex',
        flexDirection: 'column',
        gap: '8px'
    },
    label: {
        fontSize: '13px',
        fontWeight: '600',
        color: '#e5e7eb',
        textTransform: 'uppercase',
        letterSpacing: '0.04em'
    },
    input: {
        width: '100%',
        padding: '14px 16px',
        background: 'rgba(15,23,42,0.85)',
        border: '1px solid rgba(55,65,81,0.95)',
        borderRadius: '12px',
        color: '#f9fafb',
        fontSize: '14px',
        outline: 'none',
        boxSizing: 'border-box',
        transition: 'all 0.2s'
    },
    button: {
        width: '100%',
        padding: '14px 16px',
        background: 'linear-gradient(135deg, #6366f1, #a855f7)',
        color: '#fff',
        border: 'none',
        borderRadius: '12px',
        fontSize: '15px',
        fontWeight: '700',
        cursor: 'pointer',
        marginTop: '10px'
    }
};

export default Login;
